import api from "./index";

const loginUser = ({ email, password }) => {
  return new Promise(resolve => {
    resolve({
      data: {
        token: "some-token",
        user: {
          firstName: "John",
          lastName: "Doe",
          image: "data:image/jpg;base64,"
        },
      }
    })
  })
}

const createUser = ({ name, email, password }) => {
  return api.post("/users", { name, email, password })
}

export {
  createUser,
  loginUser,
}
